import React, { Component } from 'react';
import { ParallaxProivider, ParallaxBanner } from 'react-scroll-parallax';


class HomePage extends Component {
    render() {
        return(
            <ParallaxProivider>
                <h1>Home</h1>
            </ParallaxProivider>
        )
    }   
}


export default HomePage;
